import React, { Component } from 'react';
import './App.css';
import image from './cover.jpg';
class Home extends Component {
  render() {
    return (
      <div className="image-box">
        <div className="image-box-background" style={{ backgroundImage: `url(${image})` }}></div>
        <div className="image-box-overlay"></div>
      </div>
    );
  }
}

export default Home;
